import {makeAutoObservable} from "mobx"
export default class GrafMainer{
    constructor(){
        this._profit = []
        this._expend = []
        this._time = []
        makeAutoObservable(this)
    }

    setProfit(profit){
        this._profit = profit
    }

    setExpend(expend){
        this._expend = expend
    }

    setTime(time){
        this._time = time
    }

    get profit(){
        return this._profit
    }

    get expend(){
        return this._expend
    }
    
    get time(){
        return this._time
    }
}
